import React, {useState, useEffect} from 'react'
import {Card} from 'react-bootstrap'
import {FaBalanceScaleRight} from 'react-icons/fa'
import {AiOutlineArrowDown} from 'react-icons/ai'
import Axios from 'axios'

function Budget() {

    const [buds,setBuds]= useState([])

   useEffect(() => {
    Axios
    .get('https://gist.githubusercontent.com/IshamMohamed/f7ef3dbe37a176a2d6fa1e9bccb87271/raw/9cf5121cbfee3b3c88772ffb90ca2edada87b11e/something.json')
    .then (res => {
      console.log(res)
      setBuds(res.data)
    })
    .catch (err => {
      console.log(err)
    })
   }, [])

    return (
        
        <Card >
       <Card.Header><FaBalanceScaleRight size={30} style={{ fill: 'red' }} /></Card.Header>
        <Card.Body>
          <Card.Title>BUDGET</Card.Title>
          <Card.Text>
           {buds}
          </Card.Text>
        </Card.Body>
        <Card.Footer>
          <small style={{ color: 'red' }}>< AiOutlineArrowDown/>15 %</small>
          <small className="text-muted"> Since Last Month</small>
        </Card.Footer>
      </Card>
    )
}

export default Budget
